import { FETCH_HIGHLIGHTED_CITY } from '../actions/types';

export default (state = null, action) => {
  if (action.type === FETCH_HIGHLIGHTED_CITY) {
    return { ...state, [action.payload]: action.payload };
  }

  return state;
};
